import { APPCONFIG } from '../../containers/utils/constants';
import { Button } from 'primereact/button';
import './Movie.css'

const Movie  = (props) => {
    return (
        <div className='movie'>
            <img src={APPCONFIG.BASE_URL_IMAGE+props.data.pathThumbnail}/>
            <div className="movie-info">

            </div>
        </div>
    )
}

export default Movie
